    id : '',
    name : '',
    age : ''
  }])
  const AddUsers = (user) =>{
    setUsersInfo((prevState) => {
      return {...prevState, id: user.id, name:user.name, age: user.age}
    })
  }
  return (
    <div>
      <AddUser userInformation = {AddUsers}/>
      {console.log(usersInfo)}
      {/* <UserList userList = {usersInfo}/> */}
    </div>
  );
}

